import React from 'react'
import './css/BusLogs.css'
function BusLogs ({ buses }) {
  return (
    <div className='busLogs'>
      <div className='busLogs__card'>
        <h2>{buses[0].from}</h2>
      </div>
    </div>
  )
}

export default BusLogs
